import React, { Component } from 'react';
import PropTypes from 'prop-types';

class Header extends Component {


    render(){
        return(

            <div className="AttractLoop" >
               <header className="AttractLoop-Header">
                  <h1> Savings & Coupons</h1>
               </header>
            </div>  
        );

    };
}


export default Header;
